        Dictionary<int, string> Listele = new Dictionary<int, string>();
        private void Form1_Load(object sender, EventArgs e)
        {

            doldur();
            var thisOrdered = Listele.OrderBy(p => p.Key).ToList();
            string xmlpath = Application.StartupPath + "\\kayitlilar.xml";
            if (!File.Exists(xmlpath))
            {
                XmlTextWriter createXML = new XmlTextWriter(xmlpath, UTF8Encoding.UTF8);
                createXML.WriteStartDocument();
                createXML.WriteComment("İşaret Dili Programı: http://www.cmpe.boun.edu.tr/tid/?v=(VALUE)");
                createXML.WriteStartElement("Kayitlar");
                createXML.WriteEndDocument();
                createXML.Close();
                


                XmlDocument _data = new XmlDocument();
                _data.Load(xmlpath);
                foreach (var item in thisOrdered)
                {
                    XmlElement _kelime = _data.CreateElement("kelimeid");
                    _kelime.SetAttribute(item.Key.ToString(), item.Value.ToLower());
                    _data.DocumentElement.AppendChild(_kelime);
                }
                _data.Save(xmlpath);
            }
            foreach (var item in thisOrdered)
            {
                listBox1.Items.Add(item.Value);
                comboBox1.Items.Add(item.Value);
            }
            axWindowsMediaPlayer1.stretchToFit = true;


            ///işleme başla
            axWindowsMediaPlayer1.currentPlaylist.clear();
            IWMPPlaylist mustafa = axWindowsMediaPlayer1.currentPlaylist;
            string yazi = "mustafa";

            mustafa.name = yazi;
            for (int i = 0; i < yazi.Length; i++)
            {
                if (yazi[i] == ' ')
                {
                    continue;
                }
                var snc = Listele.Where(p => p.Value.ToLower() == yazi[i].ToString()).ToList();
                string _path = Application.StartupPath + "\\videos\\" + snc[0].Key + ".flv";
                IWMPMedia media = axWindowsMediaPlayer1.newMedia(_path);
                mustafa.appendItem(media);
            }
            tmr = new Timer();
            tmr.Interval = 500;
            tmr.Tick += tmr_Tick;
            axWindowsMediaPlayer1.currentPlaylist = mustafa;
            axWindowsMediaPlayer1.settings.volume = 0;
            tmr.Start();
            axWindowsMediaPlayer1.Ctlcontrols.play();
            //işlemi bitir

        }
        Timer tmr;

        void tmr_Tick(object sender, EventArgs e)
        {
            try
            {
                double dbl = axWindowsMediaPlayer1.Ctlcontrols.currentPosition;
                if (dbl > 2.0)
                    axWindowsMediaPlayer1.Ctlcontrols.next();

            }
            catch (Exception)
            {

            }
        }

        private void listBox1_MouseDoubleClick(object sender, MouseEventArgs e)
        {
            if (listBox1.SelectedItem != null)
            {
                int video_ID = Listele.Where(p => p.Value == listBox1.SelectedItem.ToString()).ToList()[0].Key;
                string _path = Application.StartupPath + "\\videos\\" + video_ID + ".flv";
                if (File.Exists(_path))
                {
                    IWMPMedia media = axWindowsMediaPlayer1.newMedia(_path);
                    axWindowsMediaPlayer1.currentPlaylist.clear();
                    axWindowsMediaPlayer1.currentPlaylist.appendItem(media);
                    axWindowsMediaPlayer1.Ctlcontrols.play();
                }
                else
                {
                    MessageBox.Show("dosya yok");
                }
            }
        }

